import React from 'react';

const Navigator = () => {
  return (
    <nav>
      <a href='#t'>Movies</a>
      <a href="#t">Series</a>
      <a href="#t">Cartoons</a>
      <a href="#t">Anime</a>
    </nav>
  );
};

export default Navigator;
